package es.iesfrancisodelosrios.acmartinez.monitorapp;



import androidx.test.ext.junit.runners.AndroidJUnit4;

import org.junit.After;
import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;


import java.util.ArrayList;

import es.iesfrancisodelosrios.acmartinez.monitorapp.model.Person;
import es.iesfrancisodelosrios.acmartinez.monitorapp.model.PersonModel;

import static org.junit.Assert.assertEquals;

@RunWith(AndroidJUnit4.class)
public class ModelTest {
    private PersonModel pm;
    @Before
    public void setUp(){

        pm = PersonModel.getInstance();
    }

    @After
    public void tearDown() {
        pm.close();
    }

    @Test
    public void crudDB() {
        Person person= new Person();
        person.setEmail("carmavi97@gmail.com");
        person.setName("Carlos");
        person.setLastName("Martinez");
        person.setBirthDate("1/12/1997");
        person.setMtl(true);
        person.setPhoto("");
        person.setSection("Tropa");
        person.setPhone("617337861");
        person.setNif("46271355r");
        assertEquals(true, pm.insert(person));

        assertEquals(6, pm.getSpinner().size());
        ArrayList<Person> personas=pm.getPersonList();
        assertEquals(personas.get(1).getName(),pm.selectById(personas.get(1).getId()));

        Person person2=new Person();
        person2.setName("Fran");
        person2.setLastName("Lopez");
        person2.setBirthDate("3/4/1995");
        person2.setMtl(false);
        person2.setSection("Tropa");
        person2.setEmail("fran@gmail.com");
        person2.setNif("123456789q");
        person2.setPhone("666666666");
        person2.setId(person.getId());
        assertEquals(true, pm.update(person2));



        assertEquals("Fran", pm.selectById(person2.getId()).getName());

        assertEquals(true, pm.delete(person2.getId()));


    }
}
